Text:
@JayOkano aku setuju untuk hapuskan subsidi ron95/97 dan diberi subsidi tersasar. subsidi ikut pendapatan isi rumah. lhdn ada data.
idea nampak senang, implement susah tapi boleh buat. kereta pon dah terbang.

kebiasaan harga barang akan naik kalau diesel yang naik.

Translated_Tweets:
@Jayokano I agree to eliminate the RON95/97 subsidy and be given a missed subsidy. Subsidies according to household income. The IRB has data.
The idea looks easy, the implementation is difficult but it can be done. The pound car is flying.

The price of the price of goods will rise if diesel goes up.

