Text:
@babylunna90 Boleh je letak harga siling. Pakai logik awak, jangan la nak bising bila harga barang naik, boleh bela/tanam/ternak sendiri. 

Jumlah ruang niaga pun boleh ditambah untuk beri peluang kepada lebih ramai peniaga. 

Aku pro rakyat. Kau ni pro apa? 😂😂😂

Translated_Tweets:
@babylunna90 can be priced at the ceiling. Use your logic, do not want to be noisy when the price of goods goes up, can defend/plant/livestock.

Even the amount of business space can be increased to give more traders the opportunity.

I'm a people pro. What are you pro? 😂😂😂

